(set! *print-length* 100)


(def distance-one
  (memoize
    (fn [^long x1 ^long x2]
      (Math/abs (- x1 x2)))))

(def distance
  (memoize
    (fn [p1 p2]
      (->> (map distance-one p1 p2)
        (take 3)
        (reduce + 0)))))

(defn parse-line [s]
  (->> s
    (re-seq #"-?\d+")
    (mapv edn/read-string)))


(defn parse [input]
  (->> input
    str/split-lines
    (map parse-line)))

(defn gte-radius [p] (get p 3))

(defn in-range1? [xyz [x y z r]]
  (<= (distance xyz [x y z]) r))


(defn f1 [input]
  (let [[bot :as bots] (->> input parse (sort-by gte-radius >))
        in-range? #(in-range1? % bot)]
    (->> bots
      (filter in-range?)
      (count))))

(assert (= 430 (f1 input)))